import QuoteList from '../components/quotes/QuoteList';
import useHttp from '../hooks/use-http';
import { getAllQuotes } from '../libs/api';

const DummyData = [
  {
    id: "q1",
    author: "Author 1",
    text: "Quote 1",
  },
  {
    id: "q2",
    author: "Author 2",
    text: "Quote 2",
  },
];

const AllQuotes = () => {
  
  return (
    <QuoteList quotes={DummyData} />
  );
};
export default AllQuotes;
